import React from "react";
import Profile from "./Profile";
import { connect } from "react-redux";
import { VUprofile } from "../../redux/dr";
import { withRouter } from "react-router-dom";

class ProfileC extends React.Component {
  componentDidMount() {
    let userid = this.props.match.params.userid;
    if (!userid) {
      userid = 2;
    }
    this.props.VUprofile(userid);
  }

  render() {}
}

let mapStateToProps = (state) => ({
  profile: state.myPage.profile,
});

let wudc = withRouter(ProfileC);

export default connect(mapStateToProps, { VUprofile })(wudc);
